import React, {Component} from 'react';
import Form from 'react-bootstrap/Form';
import InputGroup from 'react-bootstrap/InputGroup';
import Button from 'react-bootstrap/Button';
import {Redirect} from 'react-router-dom';
// import Nav from '../../containers/main';

class login extends Component {
    state = {
        email: "",
        password: "",
        loggedIn: false
    }

    submitForm = (event) => {
        event.preventDefault();
        // if() {
            this.setState({loggedIn: true});
        // }
    }
    render() {
        if(this.state.loggedIn) {
            return <Redirect to="/todolist" />
        }
        return (
            <Form onSubmit={this.submitForm}>
                <Form.Group controlId="EmailInput">
                    <InputGroup>
                        <InputGroup.Prepend>
                            <InputGroup.Text id="inputGroupPrepend"><i class="fa fas fa-key"></i></InputGroup.Text>
                        </InputGroup.Prepend>
                        <Form.Control type="password" placeholder="Enter your Email ID" aria-describedby="inputGroupPrepend" required />
                        <Form.Control.Feedback type="invalid">Please choose a username.</Form.Control.Feedback>
                    </InputGroup>
                </Form.Group>
                <Form.Group controlId="PwdInput">
                    <InputGroup>
                        <InputGroup.Prepend>
                            <InputGroup.Text id="inputGroupPrepend"><i class="fa fas fa-key"></i></InputGroup.Text>
                        </InputGroup.Prepend>
                        <Form.Control type="password" placeholder="Enter your Password" aria-describedby="inputGroupPrepend" required />
                        <Form.Control.Feedback type="invalid">Please choose a username.</Form.Control.Feedback>
                    </InputGroup>
                </Form.Group>
                <Button variant="primary" type="submit">
                    Submit 
                </Button>
                <span onClick={this.props.changeForm}>Don't have an account? Register</span>
            </Form>
        )
    }
}

export default login;
